import React, { Component } from 'react'
import FRInput from './FRInput'

class FRParentInput extends Component {

    constructor(props) {
        super(props)
    
        this.inputRef = React.createRef()
    }
    

    render() {
        return (
            <div>
                <FRInput />
                <button>Focus Input </button>
            </div>
        )
    }
}

export default FRParentInput
